export class listen_guild extends plugin {
    constructor() {
        super({
            name: "listen_guild",
            dsc: "频道监听",
            event: "message",
            priority: -1000000,
            rule: [
                {
                    reg: "",
                    fnc: "ignore_bot",
                    log: false
                },
                {
                    reg: "^(#|\/)(喵喵)?帮助$",
                    fnc: "helps",
                },
                {
                    reg: "bs",
                    fnc: "hello",
                },
            ]
        })
    }
    async check_guild(e) {
        if(!QQBot_uin.includes(e.self_id))
            return true
        else if((e.adapter == 'QQGuild') && e.group_name.match(/测试/) || ((e.adapter == 'QQBot') && !(Whitelist_group.includes(e.group_id)) ))
            return false
        return true
    }
    async ignore_bot(e){
        if(await this.check_guild(e))
            return false
            try{
                for(let i = 0; i < Master_qq.length; i++)
                await Bot[LainBot_uin].pickFriend(Master_qq[i]).sendMsg(`[频道监听]\n消息：${this.e.raw_message}\natBot：${this.e.atBot}\n发送人：${this.e.sender.card}(${this.e.user_id})\n频道名：${this.e.group_name}(${this.e.group_id})`)
            }catch(error) {
                return false;
            }
            if(!enableWhiteList)
                return false
            for (var i = 0; i < whiteListRegexes.length; i++)
                if(this.e.msg.match(whiteListRegexes[i]))
                    return false;
            return;
    }
    async hello(e){
        if(await this.check_guild(e))
            return false
        if(counter == 4)
        counter = 0
        counter ++
        logger.info(word[0])
        this.reply(word[0][counter])
        try{
            this.reply(segment.record(word[1][counter]))
        }
        catch(error) {
            return
        }
        return
    }
    async helps(e){
        if(this.check_guild(e))
            return false
            if(enableHelp){
                await this.reply(segment.image("base64:"));
                return;
            }
        }
}
